contracts/checker.sol.content:
pragma solidity ^0.8.0;

// SPDX-License-Identifier: UNLICENSED

library checker {
    function isValidOption(
        bytes32[] memory voteOptions,
        bytes32 option
    ) public pure {
        uint optionIndex;
        for (uint i = 0; i < voteOptions.length; i++) {
            // if(keccak256(abi.encodePacked(voteOptions[i])) == keccak256(abi.encodePacked(option))){
            if (voteOptions[i] == option) {
                optionIndex = i;
                break;
            }
        }
        require(voteOptions[optionIndex] == option, "Option is not valid");
    }

    function getOptionIndex(
        bytes32[] memory voteOptions,
        bytes32 option
    ) public pure returns (uint8) {
        for (uint8 i = 0; i < voteOptions.length; i++) {
            if (voteOptions[i] == option) {
                return i;
            }
        }
        revert("Invalid vote option.");
    }
}

contracts/election.sol.content:
pragma solidity ^0.8.0;

// SPDX-License-Identifier: UNLICENSED

import "./voting.sol";

contract Election is Voting {
    // count of all elections
    uint public electionCount;

    // mapping to keep track of election count to election contract address
    mapping(uint => address) electionAddresses;

    // mapping to keep track of election address to election info
    mapping(address => electionInfo) public electionDetails;

    // mapping to keep track of electionId to election details.
    mapping(uint => electionInfo) public electionIdToDetails;

    // Struct to keep track of election data.
    struct electionInfo {
        uint electionId;
        bytes32 electioName;
        address electionCreator;
        address electionAddress;
    }

    event newElectionCreated(
        uint electionId,
        bytes32 eventName,
        address electionCreator,
        address electionAddress
    );

    function getElectionCount() public view returns (uint _electionCount) {
        return electionCount;
    }

    constructor() Voting("", msg.sender) {
        electionCount = 0;
    }

    // modify function to pass in an address to use as contract creator
    function createElection(
        bytes32 _electionName
    ) public returns (address _electionAddress) {
        // uint electionId = electionCount;
        // create new instance of voting contract (an election)
        Voting newElection = new Voting(_electionName, msg.sender);
        // increase election count
        electionCount++;
        // update electionAddresses mapping
        electionAddresses[electionCount] = address(newElection);

        _electionAddress = address(newElection);

        // update mapping & struct.
        electionDetails[_electionAddress] = electionInfo(
            electionCount,
            _electionName,
            msg.sender,
            _electionAddress
        );

        electionIdToDetails[electionCount] = electionInfo(
            electionCount,
            _electionName,
            msg.sender,
            _electionAddress
        );

        emit newElectionCreated(
            electionCount,
            _electionName,
            msg.sender,
            _electionAddress
        );

        return _electionAddress;
    }

    function viewElectionAddress(
        uint _index
    ) public view returns (address _electionAddress) {
        return electionAddresses[_index];
    }

    function viewLastDeployedElection()
        public
        view
        returns (address _electionAddress)
    {
        return electionAddresses[electionCount];
    }

    function getElectionDetails(
        address _electionAddress
    ) public view returns (electionInfo memory) {
        // obtain election details from electionDetails mapping. and store in a struct.
        electionInfo memory ThisElectionInfo = electionDetails[
            _electionAddress
        ];
        // return election details
        return ThisElectionInfo;
    }

    function myElections() public view returns (electionInfo[] memory, uint) {
        uint myElectionCount = 0;

        uint currentIndex = 0;

        for (uint i = 0; i <= electionCount; i++) {
            if (electionIdToDetails[i].electionCreator == msg.sender) {
                myElectionCount += 1;
            }
        }

        electionInfo[] memory myCreatedElections = new electionInfo[](
            myElectionCount
        );

        for (uint i = 0; i <= electionCount; i++) {
            if (electionIdToDetails[i].electionCreator == msg.sender) {
                uint currentElectionId = i;
                // reference current election details
                electionInfo storage currentElection = electionIdToDetails[
                    currentElectionId
                ];
                // store current election in myElections array
                myCreatedElections[currentIndex] = currentElection;
                // increase index
                currentIndex += 1;
            }
        }
        return (myCreatedElections, myElectionCount);
    }

    function allElections() public view returns (electionInfo[] memory) {
        uint currentIndex = 0;

        electionInfo[] memory allCreatedElections = new electionInfo[](
            electionCount
        );

        for (uint i = 0; i < electionCount; i++) {
            uint currentElectionId = i + 1;
            // reference current election details
            electionInfo storage currentElection = electionIdToDetails[
                currentElectionId
            ];
            // store current election in myElections array
            allCreatedElections[currentIndex] = currentElection;
            // increase index
            currentIndex += 1;
        }
        return allCreatedElections;
    }
}

contracts/voting.sol.content:
pragma solidity ^0.8.0;
// SPDX-License-Identifier: UNLICENSED

import "./checker.sol";

contract Voting {
    address public owner;

    bytes32 public electionName;

    address public electionCreator;

    mapping(address => bool) public voters;
    mapping(address => uint) public votes;

    bytes32[] public voteOptions;

    address[] public allowedVoters;

    struct voterAndVotes {
        address validVoter;
        uint votedFor;
    }

    struct votesForVoteOptions {
        bytes32 voteOption;
        uint voteCount;
    }

    constructor(bytes32 _electionName, address electionCretor) {
        owner = msg.sender;
        electionName = _electionName;
        electionCreator = electionCretor;
    }

    modifier onlyOwnerOrSecondary() {
        require(
            msg.sender == owner || msg.sender == electionCreator,
            "Caller is not authorized."
        );
        _;
    }

    event newVote(address voter, bytes32 voteOption);

    event newVoterAdded(address[] voterAddress);

    event voterRemoved(address voterAddress);

    event addedVoteOption(bytes32 voteOption);

    function setElectionDetails(
        bytes32 _electionName
    ) public onlyOwnerOrSecondary returns (bytes32, address) {
        electionName = _electionName;
        electionCreator = msg.sender;
        return (electionName, electionCreator);
    }

    function getElectionDetails() public view returns (bytes32, address) {
        return (electionName, electionCreator);
    }

    function addAllowedVoter(address newVoter) internal {
        allowedVoters.push(newVoter);
    }

    function registerVoter(
        address[] memory newVoter
    ) public onlyOwnerOrSecondary {
        for (uint i = 0; i < newVoter.length; i++) {
            if (!voters[newVoter[i]]) {
                voters[newVoter[i]] = true;

                addAllowedVoter(newVoter[i]);
            } else {
                revert("Voter already registered");
            }
        }

        emit newVoterAdded(newVoter);
    }

    function viewVoters() public view returns (address[] memory) {
        return (allowedVoters);
    }

    function unregisterVoter(address voter) public onlyOwnerOrSecondary {
        require(voters[voter]);
        voters[voter] = false;

        for (uint i = 0; i < allowedVoters.length; i++) {
            if (allowedVoters[i] == voter) {
                allowedVoters[i] = allowedVoters[allowedVoters.length - 1];
                allowedVoters.pop();
            }
        }
        emit voterRemoved(voter);
    }

    function addVoteOption(bytes32 option) internal {
        for (uint i = 0; i < voteOptions.length; i++) {
            require(voteOptions[i] != option, "Option already exists.");
        }
        voteOptions.push(option);
        emit addedVoteOption(option);
    }

    function viewVoteOptions() public view returns (bytes32[] memory) {
        return (voteOptions);
    }

    function addVoteOptions(
        bytes32[] memory newOptions
    ) public onlyOwnerOrSecondary {
        for (uint i = 0; i < newOptions.length; i++) {
            addVoteOption(newOptions[i]);
        }
    }

    // castVotes
    function castVote(bytes32 option) public {
        require(voters[msg.sender], "voter is not registered.");
        require(votes[msg.sender] == 0, " Voter has already voted.");
        // use checker library to check if user option is valid
        checker.isValidOption(voteOptions, option);
        // get the index of the options in voteOptions array
        uint optionIndex = checker.getOptionIndex(voteOptions, option);
        // update votes mapping
        votes[msg.sender] = optionIndex + 1;
        // adding + 1 because it helps to solve the multiple votes bug.
        // users who vote for the first voteOptions can vote multiple times
        // until they choose a different option.
        emit newVote(msg.sender, option);
    }

    function getVotes() public view returns (voterAndVotes[] memory) {
        // uint variable to keep track of dynamic array
        uint voterVoteCount = 0;
        // for loop to iterate through the allowedVoters arrays,
        // for loop to chack if the users gotten from the allowedVoters have voted, with votes mapping
        for (uint i = 0; i < allowedVoters.length; i++) {
            // check
            if (voters[allowedVoters[i]] == true) {
                voterVoteCount++;
            }
        }

        voterAndVotes[] memory voterVotesArray = new voterAndVotes[](
            voterVoteCount
        );

        uint count = 0;

        // for loop to iterate through the allowedVoters arrays,
        // for loop to check if the users gotten from the allowedVoters have voted, with votes mapping
        for (uint i = 0; i < allowedVoters.length; i++) {
            // check
            if (voters[allowedVoters[i]] == true) {
                address currentVoter = allowedVoters[i];
                uint currentVote = votes[currentVoter];

                voterVotesArray[count] = voterAndVotes(
                    currentVoter,
                    currentVote
                );
                count++;
            }
        }
        return voterVotesArray;
    }

    function getVoteOptionVoteCount(bytes32 option) public view returns (uint) {
        // use checker library to check if user option is valid
        checker.isValidOption(voteOptions, option);
        // get the index of the options in voteOptions array
        uint optionIndex = checker.getOptionIndex(voteOptions, option);
        // Add one to option index to prevent index from starting from 0
        optionIndex + 1;

        // variable to keep track of vote count
        uint voteCount = 0;

        // votes[msg.sender] = optionIndex + 1;
        // for loop to loop through allowedVoters array and votes mapping
        for (uint i = 0; i < allowedVoters.length; i++) {
            if (votes[allowedVoters[i]] == optionIndex + 1) {
                voteCount++;
            }
        }
        return voteCount;
    }

    function getElectionWinner() public view returns (bytes32) {
        // struct array of votes and vote Options
        votesForVoteOptions[]
            memory votesForVoteOptionsArray = new votesForVoteOptions[](
                voteOptions.length
            ); //= new votesForVoteOptions[]

        // loop count
        uint count = 0;

        for (uint i = 0; i < voteOptions.length; i++) {
            bytes32 currentOption = voteOptions[i];
            uint optionVoteCount = getVoteOptionVoteCount(voteOptions[i]);
            votesForVoteOptionsArray[count] = votesForVoteOptions(
                currentOption,
                optionVoteCount
            );

            count++;
        }

        // Find the option with the highest vote count
        bytes32 winner = "";
        uint maxVotes = 0;
        bool isTie = false;
        for (uint i = 0; i < votesForVoteOptionsArray.length; i++) {
            if (votesForVoteOptionsArray[i].voteCount > maxVotes) {
                maxVotes = votesForVoteOptionsArray[i].voteCount;
                winner = votesForVoteOptionsArray[i].voteOption;
                isTie = false;
            } else if (votesForVoteOptionsArray[i].voteCount == maxVotes) {
                isTie = true;
            }
        }

        if (isTie) {
            return "Tie between top vote options";
        } else {
            return winner;
        }
    }
}

